import React from 'react';
import Panel from './Panel';
import './PanelList.css';

const PanelList = ({ pokedex, carNumb, cardData, currentNumb}) => {
    const PanelCompon = pokedex.map((pokemon, i) => {
        return <Panel cardPos={carNumb} panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })

    return (
        <div>
            <div className='emptyBox'>
                {}

            </div>
            <div onClick={() => {
                cardData(PanelCompon[currentNumb])
            }}>
                {PanelCompon}
            </div>
        </div>
    );
}

export default PanelList;
